DROP TABLE IF EXISTS `gy_menus`;
CREATE TABLE `gy_menus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `href` varchar(255) DEFAULT NULL COMMENT '链接',
